(function execute(inputs, outputs) {

 var cmd = './hcli topic create'

if (inputs.admin_key) { cmd = cmd +  ' --adminkey ' + inputs.admin_key } 
if (inputs.submit_key) { cmd = cmd +  ' --submitkey ' + inputs.submit_key } 
if (inputs.memo) { cmd = cmd +  ' --memo ' + inputs.memo } 

for (i=0; i < inputs.sign_with.length; i++) { cmd = cmd + ' --sign ' + inputs.sign_with[i] }

outputs.cmd = cmd 

})(inputs, outputs);

